import React from 'react'
import img from '../img/로고.png'

const Logo = () => {
  return (
    <div style={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'end',
        width: '100vw',
        height:'80px',
        backgroundColor:'#3e448b'
    }}>
        <div style={{
          fontSize:'900px',
          position:'relative',
          width:'180px', 
          height:'60px',
          right: '20px'}}>JJapJi
            </div>
    </div>
  )
}

export default Logo
